CREATE TABLE match_stats (
    match_id UUID PRIMARY KEY,
    home_user_id UUID NOT NULL,
    away_user_id UUID NOT NULL,
    start_time TIMESTAMP NOT NULL,
    home_goals_scored INT NOT NULL,
    away_goals_scored INT NOT NULL,
    end_time TIMESTAMP NOT NULL,
    match_duration INT NOT NULL,
    home_user_points INT NOT NULL,
    away_user_points INT NOT NULL
);

CREATE TABLE user_session_stats (
    user_id UUID NOT NULL,
    event_id INTEGER NOT NULL,
    type VARCHAR(50) NOT NULL,
    session_timestamp TIMESTAMP NOT NULL,
    country VARCHAR(10),
    registration_timestamp TIMESTAMP,
    timezone VARCHAR(50),
    local_datetime TIMESTAMP,
    previous_session_timestamp TIMESTAMP,
    time_diff INTEGER,
    is_new_session BOOLEAN NOT NULL,
    PRIMARY KEY (user_id, event_id)
);


